import classes from "../../style/NewMeetupForm.module.css";
import Card from "../ui/Card";
function NewMeetupForm() {
  return (
    <Card>
      <form className={classes.form}>
        <div></div>
      </form>
    </Card>
  );
}
export default NewMeetupForm;
